// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract StackTooDeepTest1 {
    function addUints(
        uint256 a,
        uint256 b,
        uint256 c,
        uint256 d,
        uint256 e,
        uint256 f,
        uint256 g,
        uint256 h
    ) external pure returns (uint256) {
        return a + b + c + d + e + f + g + h;
    }
}
